const css = {
    wrapper : `p-1 flex w-screen bg-gradient-to-r bg-slate-900 to-fuchsia-500 
            dark:text-white justify-between items-center bg-gradient-to-r bg-slate-900 to-fuchsia-500`,
    h1: `rotate-3 p-1 rounded border-2 text-5xl text-center
        lg:text-3xl text-slate-900 dark:text-slate-50`,
    menuIcon: `text-5xl`,
    spanK: `inline-block skew-y-12 `,
    switch: `dark:bg-slate-900 text-5xl`
}

module.exports = css;
